import math

def calculate_distance(directions):
    x, y = 0, 0
    for direction in directions:
        distance, unit = direction.split()
        distance = float(distance)
        if unit == "north":
            y += distance
        elif unit == "south":
            y -= distance
        elif unit == "east":
            x += distance
        elif unit == "west":
            x -= distance
    return round(math.sqrt(x**2 + y**2), 3)

